import React, { useState } from 'react';
import './App.css';
import logo from './Pictures/plogo.png';
import { Button, Form, Container, Row, Col } from 'react-bootstrap';
import axios from "axios";

const ContactPage = () => {
  // Define state for form data
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    message: ""
  });

  // Handle form input changes
  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  // Handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();
    // Make POST request to your backend
    axios.post('http://localhost:4000/ContactPage', formData)
      .then(response => {
        alert('Message sent successfully!');
        console.log(response.data);
      })
      .catch(error => {
        console.error('Failed to send message:', error);
        alert('Failed to send message.');
      });

    // Optionally reset form after sending
    setFormData({
      firstName: "",
      lastName: "",
      email: "",
      message: ""
    });
  };

  const NavbarComponent = () => {
    return (
      <nav className="navbar">
        <Container>
          <div className="logo">
          <a href="/">
            <img style={{ width: '200px', height: '80%' }} src={logo} alt="Logo" />
            </a>
          </div>
          <ul className="nav-links">
            <li><a href="/valet-parking">Valet Parking</a></li>
            <li><a href="/commercial-services">Commercial Services</a></li>
            <li><a href="/Careers">Careers</a></li>
            <li><a href="/about">About</a></li>
            <li><a href="/ContactPage">Contact</a></li>
          </ul>
          <button className="quote-btn" style={{ padding:'13px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black', textDecoration: 'none'  }}>Request a Quote</a> </button>
        </Container>
      </nav>
    );
  };
  const Footer = () => {
    return (
      <footer className="footer">
        <Container>
          <Row>
            <Col md={3} sm={6}>
              <h5>Peninsula Parking</h5>
              <p><i className="fas fa-phone"></i> (855) PEN-PARK</p>
              <p><i className="fas fa-phone"></i> info@peninsulaparking.com</p>
              <p><i className="fas fa-phone"></i> 541 Taylor Way Suite 12 </p>
              <p><i className="fas fa-phone"></i> San Carlos, CA 94070</p>
            </Col>
            <Col md={3} sm={6}>
              <h5>Services</h5>
              <ul>
                <li>Valet Parking</li>
                <li>Commercial Services</li>
                {/* Add more services as needed */}
              </ul>
            </Col>
            <Col md={3} sm={6}>
              <h5>Company</h5>
              <ul>
                <li>Employment</li>
                <li>About Us</li>
                <li>Contact Us</li>

              </ul>
            </Col>
            <Col md={3} sm={6}>
              <h5>Locations</h5>
              <ul>
                <li>San Jose Valet Parking Services</li>
                <li>San Francisco Valet Parking Services</li>
                <li>Los Altos Valet Parking Services</li>
                {/* Add more locations as needed */}
              </ul>
            </Col>
          </Row>
        </Container>
      </footer>
    );
  }

  return (
<div>
    <div>
     {NavbarComponent()}

      <Container >
        <Row>
          <Col>
            <div className="contact-details">
